import React, {Component} from 'react';
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import Sidebar from "../nav_bars/Sidebar";
import SearchEmployeeComponent from "./home/SearchEmployeeComponent";
import CreateFlightComponent from "../add_components/CreateFlightComponent";
import SearchFlightComponent from "./home/SearchFlightComponent";
import DepartureFlightComponent from "./flight/DepartureFlightComponent";
import ArrivalFlightsComponent from "./flight/ArrivalFlightsComponent";
import SearchAircraftComponent from "./flight/SearchAircraftComponent";
import SearchClientsComponent from "./clients/SearchClientsComponent";
import SearchCompaniesComponent from "./companies/SearchCompaniesComponent";
import CreateAircraftComponent from "../add_components/CreateAircraftComponent";
import CreateEmployeeComponent from "../add_components/CreateEmployeeComponent";
import CreateCompanyComponent from "../add_components/CreateCompanyComponent";
import CreateClientComponent from "../add_components/CreateClientComponent";
import TestMainPage from "../TestMainPage";

class MainPage extends Component {
    render() {
        return (
            <Router>
                <Sidebar/>
                <Switch>
                    <Route exact path='/home' component={TestMainPage}/>
                    <Route exact path='/home/search-for-employee' component={SearchEmployeeComponent}/>
                    <Route path='/home/search-for-flight' exact component={SearchFlightComponent}/>
                    <Route path='/flight/departure-flight' exact component={DepartureFlightComponent}/>
                    <Route path='/flight/arrival-flight' exact component={ArrivalFlightsComponent}/>
                    <Route path='/flight/aircraft' exact component={SearchAircraftComponent}/>
                    <Route path='/clients' exact component={SearchClientsComponent}/>
                    <Route path='/companies' exact component={SearchCompaniesComponent}/>
                    <Route path='/add-new-flight' exact component={CreateFlightComponent}/>
                    <Route path='/add-new-aircraft' exact component={CreateAircraftComponent}/>
                    <Route path='/add-new-employee' exact component={CreateEmployeeComponent}/>
                    <Route path='/add-new-company' exact component={CreateCompanyComponent}/>
                    <Route path='/add-new-client' exact component={CreateClientComponent}/>
                </Switch>
            </Router>
        );
    }
}

export default MainPage;
